func removeStars(s string) string {
	trimmed := strings.ReplaceAll(s, "*", "")
	if float32(len(s)) - float32(len(trimmed)) >= (0.5 * float32(len(s))) {
		return ""
	}
	
    var stack []byte
    
    for i := 0; i < len(s); i++ {
        if s[i] == '*' {
            stack = stack[:len(stack)-1]
        } else {
            stack = append(stack, s[i])
        }
    }
    
    return string(stack)
}

